function gpslatlon(lat1,lon1,lat2,lon2,units="km"){let s;switch(units){case"ft":s=3280.8399;break;case"yd":s=1093.6133;break;case"ml":s=.6214;break;case"nm":s=.5399;break;case"nl":s=.1799;break;case"m":s=1e3;break;case"km":s=1}let p=.017453292519943295,a=.5-Math.cos((lat2-lat1)*p)/2+Math.cos(lat1*p)*Math.cos(lat2*p)*(1-Math.cos((lon2-lon1)*p))/2;return r=Math.round(12742*s*Math.asin(Math.sqrt(a))*1e3)/1e3,r}module.exports=gpslatlon;